import { MdDelete } from "react-icons/md";


const Note = () => {
    return <div className="Note"> 
        <span> Hello </span>
        <div className="note-footer">
            <small>30/9/2021</small>
            <MdDelete className='delete-icon' size = '1.3'/>
        </div>
    </div>
}
export default Note;
